INSERT INTO `wp_postmeta` VALUES("126", "34", "_about_section_about_image", "field_5f20f04fff65d");
INSERT INTO `wp_postmeta` VALUES("127", "34", "about_section_about_content_0_content", "We work with only locally-sourced materials, and so all our products are sustainable. Our team understands the need to protect the environment, and that is why we don’t use trees and logs from overseas or other states.");
INSERT INTO `wp_postmeta` VALUES("128", "34", "_about_section_about_content_0_content", "field_5f20f0b4ff65f");
INSERT INTO `wp_postmeta` VALUES("129", "34", "about_section_about_content_1_content", "Choose from our selection of black walnut, cherry, maple, red oak white oak pin oak, sassafras, elm, honey locust, chestnut, pine, cedar and more, and we’ll create a stunning item that meets and exceeds your expectations.");
INSERT INTO `wp_postmeta` VALUES("130", "34", "_about_section_about_content_1_content", "field_5f20f0b4ff65f");
INSERT INTO `wp_postmeta` VALUES("131", "34", "about_section_about_content_2_content", "Our experts will discuss every element of the design and manufacturing process with you before we start work. So, you remain 100% in control over the entire item. Still, of course we are still happy to offer advice and suggestions.");
INSERT INTO `wp_postmeta` VALUES("132", "34", "_about_section_about_content_2_content", "field_5f20f0b4ff65f");
