INSERT INTO `wp_posts` VALUES("34", "1", "2020-07-26 15:27:17", "2020-07-26 15:27:17", "<!-- wp:paragraph -->\n<p>We are the number one provider of design and manufacturing services for custom build live edge tables and other rustic furniture in New York and long island today. With years of experience in the industry, Our team of experts knows precisely how to achieve the result you desire for any potential project. We work to the highest of standards, and our luxurious pieces are guaranteed to improve the interior design and functionality of any space.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Whether you\'re a private individual or a business owner with many bars and restaurants, I\'ll Timberworks is a brand you can trust when renovating or giving your property a new lease of life.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":4} -->\n<h4>Let\'s discuss your project</h4>\n<!-- /wp:heading -->", "Welcome to LI TimberWorks", "", "publish", "closed", "closed", "", "home", "", "", "2020-08-06 20:15:40", "2020-08-06 20:15:40", "", "0", "http://litimberwork.wpengine.com/?page_id=34", "0", "page", "", "0");
