INSERT INTO `wp_posts` VALUES("138", "1", "2020-07-30 03:23:41", "2020-07-30 03:23:41", "<!-- wp:paragraph -->\n<p><strong>L.I. Timberworks takes pride in quality not quantity</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>We take pride in time tested art of wood joinery. Our tables are not just gang glued or screwed together. Our tables use a variety of techniques of wood joinery including: Mortise &amp; Tenon, Split Wedge Tenons, Through Tenons, Dove Tails, Sliding Dove Tails, Domino Joinery, Spline, and Joinery Butterflies.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Our stock is carefully selected and milled ourselves and if we don\'t have a particular species in stock we can get virtually any species via our supplier. We offer a total custom experience in designing your own table style and base, from metal base to wood to steel or anything in between.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Virtually any industrial design can be made by our metal fabricator \" @ SEK Designs\". A unique blend of steel and wood often creates elegance &amp; functionality. More traditional 4 post trestle tables can be designed for your one of a kind table as well. We believe a dining room table should last a lifetime, just as a lifetime is spent using it.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":4} -->\n<h4>Let\'s discuss your project</h4>\n<!-- /wp:heading -->", "Tables", "", "publish", "open", "open", "", "tables", "", "", "2020-08-08 17:56:41", "2020-08-08 17:56:41", "", "0", "http://litimberwork.wpengine.com/?p=138", "0", "post", "", "0");
INSERT INTO `wp_posts` VALUES("140", "1", "2020-07-30 03:26:15", "2020-07-30 03:26:15", "<!-- wp:paragraph -->\n<p>Our custom wine cellars can be designed in any size, with any budget. Finding the perfect place to store your wine can be anywhere from a small wine cellar closet design to the largest wine room design.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":3,\"className\":\"h3 d-inline-block\"} -->\n<h3 class=\"h3 d-inline-block\">Wine Racks</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Our team knows that property owners who wish to create a wine room will need luxurious wine racks that look stunning and perform as expected. We understand that strength and durability are just as vital as appearance. That is why we never compromise on quality when working on your design or choosing the materials.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Our manufacturing specialist will use their skills and knowledge to ensure your wine racks are strong enough to carry the weight and attractive enough to ass to the aesthetic of your space. We can create wine racks in any style using locally-sourced trees and our wood Mizer sawmill in a matter of days. So, if you need to get your room finished quickly, you shouldn\'t look anywhere else</p>\n<!-- /wp:paragraph -->", "Custom Wine Rooms", "", "publish", "open", "open", "", "wine-rooms", "", "", "2020-08-08 12:28:35", "2020-08-08 12:28:35", "", "0", "http://litimberwork.wpengine.com/?p=140", "2", "post", "", "0");
INSERT INTO `wp_posts` VALUES("141", "1", "2020-07-30 03:46:36", "2020-07-30 03:46:36", "<!-- wp:paragraph -->\n<p>Our built-ins is a one of a kind custom process. You will give us your ideas and we will hand draw your new wall unit. No computer or CAD systems or programs are used. Its a hand-drawn personal touch that is used to create and build your project. All of our built-ins are made of solid wood. No pressboard is used, our cabinets are made from 3/4 cabinet grade 11ply plywood.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Our built-ins are unique to every space they are built to fill.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":4} -->\n<h4>Let\'s discuss your project</h4>\n<!-- /wp:heading -->", "Built-ins", "", "publish", "open", "open", "", "built-ins", "", "", "2020-08-08 12:27:11", "2020-08-08 12:27:11", "", "0", "http://litimberwork.wpengine.com/?p=141", "4", "post", "", "0");
INSERT INTO `wp_posts` VALUES("142", "1", "2020-07-30 03:47:03", "2020-07-30 03:47:03", "<!-- wp:paragraph -->\n<p>We offer a total custom experience in designing your own unique woodwork, from metal base to wood to steel or anything in between. Our team of experts know precisely how to achieve the results you desire for any potential project.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":4} -->\n<h4>Let\'s discuss this project</h4>\n<!-- /wp:heading -->", "Custom Woodworks", "", "publish", "open", "open", "", "custom-woodworks", "", "", "2020-08-08 12:26:19", "2020-08-08 12:26:19", "", "0", "http://litimberwork.wpengine.com/?p=142", "3", "post", "", "0");
INSERT INTO `wp_posts` VALUES("143", "1", "2020-07-30 03:47:27", "2020-07-30 03:47:27", "<!-- wp:paragraph -->\n<p>All of our mantels are milled in house and dried for a number of years before ready for install. We stock heavy timber solid wood mantels, some up to 8\'\' thick in a variety of species you can choose from square stock or live edge for your fireplace.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":4} -->\n<h4>Let\'s discuss this project</h4>\n<!-- /wp:heading -->", "Mantels", "", "publish", "open", "open", "", "mantels", "", "", "2020-08-08 12:25:07", "2020-08-08 12:25:07", "", "0", "http://litimberwork.wpengine.com/?p=143", "6", "post", "", "0");
INSERT INTO `wp_posts` VALUES("145", "1", "2020-07-30 03:48:25", "2020-07-30 03:48:25", "<!-- wp:paragraph -->\n<p>Our solid wood counters can be made from a variety of species including black walnut, maple, and hickory. Our countertops are glued and joined using domino mortise tenon style joinery giving each countertop exceptional strength.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>There are different styles to choose from: Plank, Edge Grain, Butcher Block, Live Edge, and many more!</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":4} -->\n<h4>Let\'s discuss this project</h4>\n<!-- /wp:heading -->", "Solid Countertops", "", "publish", "open", "open", "", "solid-countertops", "", "", "2020-08-08 12:23:13", "2020-08-08 12:23:13", "", "0", "http://litimberwork.wpengine.com/?p=145", "7", "post", "", "0");
INSERT INTO `wp_posts` VALUES("146", "1", "2020-07-30 03:48:44", "2020-07-30 03:48:44", "<!-- wp:paragraph -->\n<p>Our bar tops speak for themselves. We go to painstaking lengths to choose the right piece of wood that will create a work of art for your bar top. We offer traditional pub-style bars with Chicago rail to 4\'\' thick black walnut live edge rail with butterflies.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Virtually any style bar can be created.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":4} -->\n<h4>Let\'s discuss your project</h4>\n<!-- /wp:heading -->", "Bar Tops", "", "publish", "open", "open", "", "bar-tops", "", "", "2020-08-08 12:20:51", "2020-08-08 12:20:51", "", "0", "http://litimberwork.wpengine.com/?p=146", "1", "post", "", "0");
INSERT INTO `wp_posts` VALUES("147", "1", "2020-07-30 03:49:05", "2020-07-30 03:49:05", "<!-- wp:paragraph -->\n<p>Our live edge slab tables and bars are wonders to behold. Not only are they unique pieces of work, but they are also built to last much longer than any mass-produced product you may purchase. Adding a live edge table to your establishment will help to create a rustic atmosphere that many bar and restaurant owners enjoy these days.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":4} -->\n<h4>Let\'s discuss your project</h4>\n<!-- /wp:heading -->", "Commercial Work", "", "publish", "open", "open", "", "commercial-work", "", "", "2020-08-08 12:32:48", "2020-08-08 12:32:48", "", "0", "http://litimberwork.wpengine.com/?p=147", "5", "post", "", "0");
